import React from "react";
import "./Chart.css"
import ChartBar from "./ChartBar";

const Chart = props => {
    const months = ["Jan","Feb","Mar"]
    return <div className="chart">
        months.map((m) => ( <ChartBar month = {m}/>))
        <ChartBar />
    </div>
}

export default Chart;
